// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

contract EnvasadoContract {
    struct Envasado {
        uint256 hash_anterior;
        uint256 nro_lote;
        uint256 nro_botellas;
        bool aprobado;
        uint256 createdAt;
    }

    mapping(address => mapping(uint256 => Envasado)) public lista;

    function crear(
        uint256 _hash_anterior,
        uint256 _nro_lote,
        uint256 _nro_botellas
    ) public {
        lista[msg.sender][_hash_anterior] = Envasado(
            _hash_anterior,
            _nro_lote,
            _nro_botellas,
            false,
            block.timestamp
        );
    }

    function actualizar(
        uint256 _id,
        uint256 _nro_lote,
        uint256 _nro_botellas
    ) public {
        Envasado memory _item = lista[msg.sender][_id];
        if (_item.aprobado == false) {
            _item.nro_lote = _nro_lote;
            _item.nro_botellas = _nro_botellas;
            lista[msg.sender][_id] = _item;
        }
    }

    function aprobarProceso(uint256 _id) public {
        Envasado memory _item = lista[msg.sender][_id];
        _item.aprobado = true;
        lista[msg.sender][_id] = _item;
    }
}
